import React from "react";

import HeaderImage1 from "../../../../../assets/images/headermain1";
import HeaderImage2 from "../../../../../assets/images/headermain2";

const headerimages = (props) => (
  <div>
    <div style={{ width: "50%", margin: "auto", height: "50%" }}>
      <img src={HeaderImage1} alt="MyHeader1"></img>
    </div>
    <div>
      <img src={HeaderImage2} alt="MyHeader2"></img>
    </div>
  </div>
);

export default headerimages;
